import React from 'react';
import ClassNames from 'classnames';

import './Button.scss';

const Button = ({ href, text, icon, classes }) => {
  return (
    <a href={href} className={classes ? ClassNames('btn', ...classes) : 'btn'}>{text}</a>
  )
}

export default Button;
